graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Module A</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Initialize" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Initialize</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Initialize A</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Process" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Process</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Process A</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Validate" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Validate</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Validate A</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Complete" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Complete</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Complete A</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "Initialize" -> "Process" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Process" -> "Validate" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Validate" -> "Complete" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
